import styled from 'styled-components'

const StyledFooter = styled.footer`
  /* margin: 5.4rem 0; */
  height: 500px;
  background-color: ${props => props.theme.offWhite};
`

const Footer = () => (
  <StyledFooter />
)


export default Footer
